import React from 'react'
import { useLocation, useNavigate } from 'react-router-dom'
import { Button } from '@material-ui/core';
const Result = () => {
    const navigate=useNavigate();
    const DatafromQuiz=useLocation();
  return (
    <div>
       <div className='result'>
        <div className='image-header-subjects'>
          <img/>
        </div>
        <p>you have scored {DatafromQuiz.state.score} out of {DatafromQuiz.state.Length}</p>
        <h2>
          {DatafromQuiz.state.score / DatafromQuiz.state.Length > 0.8
            ? ` congratulations you got ${(DatafromQuiz.state.score / DatafromQuiz.state.Length) * 100}%`
            : ' study to achieve a better result'}
            
        </h2>
        <Button className="bg-info" onClick={()=>{navigate('/Quiz',{state:{subj:DatafromQuiz.state.subj}})}}>retry</Button>
      </div>
    </div>
  )
}

export default Result;
